test('Criar um novo Crachá', async () => {
  await Usuarios.criarUsuario(dataUsuario);
  const idUsuario = await Usuarios.login(dataUsuario);

  const idCracha = await Crachas.criarCracha({
    nome: dataCracha.nome,
    matricula: dataCracha.matricula,
    foto: dataCracha.foto,
    imagem: imagemCracha,
    idCurso: 1,
    idUsuario: idUsuario,
  });
  expect(idCracha).toBeTruthy();

  await Crachas.deletarCracha(idCracha);
  await Usuarios.deletarUsuario(idUsuario);
});

